import React from "react";
import Header from "./components/shared/Header";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./components/Home";
import DrinkIndex from "./components/views/drink/DrinkIndex";
import DrinksDetails from "./components/views/drink/DrinkDetails";
import DrinkCreate from "./components/views/drink/DrinkCreate";

const App = () => (
    <Router>
        <Header />
        <Switch>
            <Route exact path="/">
                <Home />
            </Route>
            <Route path="/home">
                <Home />
            </Route>
            <Route path="/drinks">
                <DrinkIndex />
            </Route>
            <Route path="/drinks/:id">
                <DrinksDetails />
            </Route>
            <Route path="/drinks/create">
                <DrinkCreate />
            </Route>
            <Route path="/drinks">
                <DrinkIndex />
            </Route>
            <h1>404</h1>
        </Switch>
    </Router>
);

export default App;
